import React from 'react';
import { connect } from 'react-redux';
import { Avatar } from '@mui/material';
import './fav-channel.scss';

const FavChannel = props => {

    const cards = props.favData.map((cur,index) => {
        return (
            <div className='card-holder' key={index}>
                <Avatar src={require('../assets/'+cur.thumbnail).default} />
                <div className='card'>

                </div>
            </div>
        )
    })
    return (
        <div className="fav-container">
            <div className='heading-title'>
                <div className='title'>Follow Your favourites</div>
                <div className='sub-title'>And get you dishes suggestion from their Menu Card</div>
            </div>
            <div className='carousal'>
                {cards}
            </div>

        </div>
    )
};

const mapStateToProps = state => {
    console.log(state.foodData.favchannel)
    return {
        favData: state.foodData.favchannel
    }
}
export default connect(mapStateToProps)(FavChannel);
